Первоначальное описание:
Проверка модели пользовательского опыта продуктами De’Longhi. Группа людей будет тестировать продукты делонги и прямых конкурентов в течение определённого времени. Также будет опрошена группа владельцев кофемашин на предмет их опыта. По итогам тестирования и опроса нужно будет:
•	Сформулировать USP для делонги, их конкурентов, а также слабые стороны De’Lonhgi.
•	Сформулировать некое рекламное сообщение на базе взаимодействия с этими продуктами.
•	Провести анализ опыта реальных пользователей.

Цели исследования:
1 Понять насколько и чем именно наш продукт лучше/ хуже других;
2 Адекватно ли мы оцениваем его стоимость ;
3 Какие функции наиболее востребованы;
4 Что ценят в продукте и почему его используют в принципе;
5 Получить рекламное сообщение, например: 9 из 10 человек отметили...
